import styled from "styled-components";

const HeaderStyled = styled.div`
	width:100%;
	height:40px;
	background-color:#000;
	display:flex;
	justify-content: center;
	p10
	a{
		color:#666060;
		text-decoration:none;
	}
`
export default HeaderStyled
